verse: MRK.006.053
translations:
  kpx-kpx: Katelahaito e ke houi vaki moleve lohoale Genesaletie velehovoi abu bouti
    mai esagae mavolu.
  okv-H: Eto Iesu te amita ambotani te aingeto e nga ta puvuto umo oiho enda javo
    Gennesaret ta puvuto
  tbo-tbo: Hi damana po Genesaleta u tuponana hi gota po hai wam hi hepaya.
  mal-C: അവർ തടാകത്തിന്റെ അക്കരെ ഗെന്നേസരെത്തിൽ എത്തി, വള്ളം അവിടെ അടുപ്പിച്ചു.
  grc-SR: Καὶ διαπεράσαντες ⸂ἦλθον ἐπὶ τὴν γῆν⸃ Γεννησαρέτ, καὶ προσωρμίσθησαν.
  bgc-bgc: वे गलील समुन्दर पार करकै गन्नेसरत परदेस म्ह पोहचे, अर किस्ती घाट पै लाई।
  khz-khz: Ne gati na gevanagito kovu kavatai, Genesareta tanonai gekwarato. Geria
    gati vonai gekwatu-kauato.
  deu-TKW: Und sie fuhren hinüber ans Land und kamen nach Gennesaret und legen an.
  zsr-NT: Guladödëꞌ yetsláꞌa nis zxön Jesús len bönniꞌ daꞌquëꞌ Lëꞌ, guladxinëꞌ ga
    nac lu xyugac bunách Genesaret. Guludxiguëꞌë bárcodauꞌ luyú bidx niꞌ.
  lin-lin: Sima na bango kokatisa ebale, bakomaki na mabele ya Genezareti mpe bakangisaki
    bwato na bango na libongo.
  hns-NT: Tab djab oesabhan samoendar ke oepaar pahoetjal tab Genesaaret ke sahar
    ke nagietj aai gail. Hoewa par oesab bot baanh deis.
  noa-E: Maimua warag ãba ërëubaadëwi thoom igar deeum durr Genesaret anʉm phẽeubagkhabaimaawai
    warre amach wëttarr bote jʉ̈ sĩujim aajem.
  eng-EMTV: And having crossed over, they came to the land of Gennesaret and anchored
    there.
  mib-NT: Te ni quenda jíyo ya jiín de nuū mar ún, ní jinū yā región Genesaret. Te
    yundúte un ní cajihni de barco.
  bea-bea: Kootoo naghateskyi tsi, koonaghaghintyetl tike Gennesaret, kahchu tghaghiyetl.
  lif-NT2: हे़क्‍क्‍याङ् खे़ङ्‌हाॽरे़ वरक्‍किल्‍ले़ नाधाःम्‍बि मे़गाःक्‍तुआङ् गने़सरे़त्तो
    मे़गे़रे़आङ् खःङ्‌बेन् इमे़घेःक्‍खु॥ ये़सुःन् खःङ्‌बेलाम् लःन्‍दे़नुमे़ःन्‍ने
    खे़प्‍मोबा मनाहाॽ के़रे़क्‍ले़ खुने़ॽ कुसिङ् मे़निःत्तु॥
  xnj-xnj: Vakakupuka nyanja, vakahika kumuji wa ku Genezaleti vakahuyimika watu.
  mmx-mmx: La diga xan polo lavatdan kis la diga oso to at lenep kangka Genesaret.
  cbr-NT: Parúmpapa 'ucë manan cuani Genesaret cacë menu bëbaquin ca anu aín nunti
    tëcërëcacëxa.
  tee-NT: Acsni tacha'alh ju lhimak'antacutni ju atants'in ju Jesús chai ix'amamaka'ui
    pus tacha'alh ju xalacat'un Genesaret. Anch ju tach'i'ula ju ixbarco'an.
  eng-LSV: And having passed over, they came on the land of Gennesaret, and drew to
    the shore,
  cak-NT: Y reje' xek'ax parui' ri choy (ya') ri' y xe'apon chuchi-ya' pa Genesaret.
  pah-NT: Igwete Jesus'g̃a hero'yahavi herovahema Genesarépeve'g̃a gwyri pe nhapytiamo.
  sja-NT: Panadak'ãri lago k'ĩraik'a eere, wiibainajida Genesaret eujãde. Mama barco
    jɨ̃ bɨjida to ide.
  xed-xed: Tahula tsughwaɗapta taŋ ta drəf, ɓhadaghar həŋ ta haɗika Genazaret, ka
    hbanata həŋ ta kwambala taŋ ta wa drəf hada.
  mks-NT: Na̱xi̱nu̱ na̱ inga xoo tañu̱hú ta na̱cató ndaa na barco yuhú tañu̱hú cán
    já na̱sa̱a̱ na̱ ñundáhyi̱ Genesaret.
  gfk-S: Be Jisas ma ira nuno bulu na harausur di ga balos no tamat na taho kis, di
    gom hanawat ter tano katano Genasaret. Kaia, di ga kute kawase ter no mon.
  bmu-bmu: O aŋgö kutuba likepŋe Genesaret mire aŋgota waŋge mosöta saknöŋ geget.
  dgz-dgz: Mu awan ame gamu to nugusene at Generaset gerata en natane.
  eng-GNV: And they came ouer, and went into the land of Gennesaret, and arriued.
  zaa-NT: De beyacca guttè cabi lo indatù'a nna bitsina' cabi región nu lá Genesaret.
    Nía nna bexìqquia cabi bárcuá ru'a indatù'a.
  eng-WEBSTER: And when they had passed over, they came into the land of Gennesaret,
    and drew to the shore.
  guh-guh: Jesús pijajivi jerata yajavapata puca itsapanabelia. Pata Genesaret nacuayabelia.
    Peyapatsijera bajarajota puca itapata querataruta.
  bon-bon: Yeesu teeme abiberäja bägrä cama sawa ne yuurige, atyaramtige Genesareta
    gawe cabu me, siige poo te puma ipyige.
  nhw-BL: Jesús huan imomachtijcahua quiixcotonque nopa hueyi atl huan ajsitoj ateno
    ipan altepetl Genesaret. Huan nepa quiilpijque inincuaacal.
  swh-ONEN: Walipokwisha kuvuka, wakafika nchi ya Genesareti, wakatia nanga.
  wbi-wbi: Yevalovwike imwambo jingi, vakafika iisi ija Genesareti ingalava jikava
    pa vwimo.
  bba-bba: Sɑnɑm mɛ bɑ tɔburɑ bɑ kpɑ, bɑ turɑ Genɛsɑrɛtin temɔ, mɑ bɑ ɡooru ɡirɑri.
  eng-KJVCPB: And when they had passed over, they came into the land of Genesaret,
    and drew to the shore.
  kgk-NT: Upéi katu oho yugwarusu rovái. Genezaré tetã-my ogwahẽ oho-vy hikwái. Isã-py
    onhapytĩ kanóa. Osẽ kanóa-gwi.
  waj-waj: Iya nnoori sainai yoosinna Genesareeta oro varuduu nnoori siriivaki nnida
    kanuuvaa yeenaivaa haru kiada
  cpy-cpy: Areetee-yakani intatsikiro, ojeeki nampitsi iiteetziri Piyompi-shaari,
    roojota-paakiro pitotsi ochereeteki.
  ekk-PKP: Pärast mere ületamist jõudsid nad Genneesaretti ja panid paadi ankrusse.
  mpx-mpx: Hoga hi alupanet-an hi na hi tan panuwa Genesaleta, inoke waga ana anka
    hi alipalo.
  wbp-wbp: Kujalu yukajarra ngaka pawurtu-kurlu murrarninginti-kari-kirra Nijirutu-kurra,
    pawurtu-jangkalu jitija muku. Ngula-jangkajulu jitinjarla pawurtuju warurnu watiya-kurra.
  luo-luo: Kane gisengʼado loka komachielo negichopo Genesaret, mi gigowo kanyo.
  nhe-NT: Jesús huan imomachtijcahua quiixcotonque nopa hueyi atl huan ajsitoj ateno
    ipan altepetl Genesaret. Huan nepa quiilpijque inincuacanahua.
  aii-aii: ܘܟܲܕ ܥܒ݂ܝܼܪܗܘܿܢ ܠܡܲܪܙܵܐ ܐܚܹܪܢܵܐ، ܐܬܹ‌ܐ ܠܗܘܿܢ ܠܐܲܪܥܵܐ ܕܓܹܢܹܣܲܪ، ܘܓܪܝܼܫ ܠܗܘܿܢ
    ܠܡܲܪܙܵܐ.
  esk-NT: Taapkua ikaaqługu narvaq tulaŋniqsut Gennesaret-mun.
  msb-msb: Sa inda pagtalabok nakaabot sinda sa lugar san Genesaret kag didto sinda
    nagdungka.
  cpa-NT: Jøng² ca¹dsi¹lé²dsa hŋoh¹³ jmøi² ca²ton², huø¹ ja³tén¹² Genesaret. Ja³jøng²
    ca¹cǿin²dsa barco chiuh³ jmøi².
  dso-dso: ଜିସୁ ଆରି ତାର୍‌ ସିସ୍‌ମନ୍‌ ଗାଡ୍‌ ଲଙ୍ଗି ଗିନେସରତ୍‌ ବାଟେ ଜାଇକରି କେଟ୍‌ଲାଇ ଆରି
    ଗାଡ୍‌ପାଲି ଡଙ୍ଗା ବାନ୍ଦ୍‌ଲାଇ ।
  meu-meu: Idia na e heau hanai, Genesaret konena ai e toa.
  yva-NT: Arono usisa no onae tuga ranijo warani no munijo Genesaret, wo oramo kamintuge
    raugasya.
  dgc-dgc: Nadid, to kéahabes de, éy pinumundu side ta Genesaret.
  zpm-NT: Zeeṉe laa zho bdziṉ stib nëz ro nis co, zaatne nac xtan zha Genesaret, dzigo
    laa zho pxidoo xbarcw zho ro nis ga.
  hix-NT: Wetotxownà haxa hatà, Txesus komo. Txeey, katxownà hatà, Xenesarye yamtar
    hona. Tkanawar komo yowahtotxownà hatà.
  sim-sim: Jisas nga ol orin tiyandari ondo nga leukun li mbuhu yanga Genesaretik
    limu lawura.
  npi-ULB: जब उहाँहरू पारी तरे, उहाँहरू गनेसरेतमा आए, र डुङ्गालाई त्यहीँ अड्‍याए ।
  cgc-cgc: Paglakted Jesus daw iya na mga tinudluan naan ta liyo na baybay ta Dagat
    Galilea, gadungka danen an ta banwa na Genesaret daw naan dya gapundo.
  tim-tim: Bâtgum hâtikom metem Genesaret hânân togom waŋga hikombiâ kilep.
  yor-yor: Lẹ́yìn tí wọ́n la Òkun náà kọjá, wọ́n gúnlẹ̀ sí Genesareti. Wọ́n sì so
    ọkọ̀ sí èbúté.
  wos-wos: Jisas déka du wali di tukweseke angé sakuré gunjambémbu yae di Genesaretna
    héfambu xaku. Xaakwa di gunjambé hari di mimbu lékitaka.
  emp-NTPO: Chã wãnada Genesare druad̶e jũẽnaped̶a doya wib̶arisid̶aa.
  eng-F35: After they had crossed over, they came to the land of Genesaret and anchored
    there.
  ind-ind: Yesus dan murid-murid-Nya pun tiba di kampung Genesaret. Waktu mereka turun
    dan mengikat perahu, orang-orang di situ langsung mengenali bahwa Dia adalah Yesus.
  pes-OPCB: وقتی به آن سوی دریاچه رسیدند، در ساحل جنیسارت از قایق پیاده شدند و در
    آنجا لنگر انداختند.
  mpt-mpt: I inaniba weseme obetniba aamuke yalaniba watniba Genesalet betan wat unaniba
    weseme ye obginabiba
  ssx-ssx: Mo kawasona꞉ ikali tunkula puaata꞉ Kenesatete nane opolo puaata꞉ mo kawaso
    a꞉ndimikime.
  mkl-mkl: Iyi ɑ̀ kuɑ tenkuu ɑ̀ tɑ̃ ŋɔi ɑ̀ to ilɛi Genesɑrɛti ɑ̀ koo ɑ̀ dĩ ɑkɔ nŋɑ
    bi ku leekĩu.
  gaq-gaq: ଜିସୁ ଆରି ମେଇଙ୍ଗ୍‌ନେ ସିସ୍‌‌ଇଙ୍ଗ୍‌ କେଣ୍ତିଆ ପୁଆଃଚେ ଗିନେସରତ୍ ଏରିଆ ୱେଚାଆର୍‌କେ
    । ମେଇଙ୍ଗ୍‌ ତରାକେ ଆତ୍ ଅରିଆ ଗାଗ୍‌ବି ଆର୍‌କେ ।
  gof-RNT: Entti abbaa pinnidi, Gensareexe biittaa gakkidi, wogoluwa gaxa shiishidi
    qachchidosona.
  unx-unx: ୟୀଶୁ ଆଡଃ ଆୟାଃ ଚେଲାକ ଦରେୟା ପାରମ୍‌କେଦ୍‌ଚି ଗିନେସରେତ୍‌ ନୁତୁମ୍‌ ପାର୍‌ଗାନ୍‌ତେକ
    ସେଟେର୍‌ୟାନା, ଆଡଃ ଲାଉକାକେ ତଲ୍‌କେଦାକ ।
  gah-gah: Keza vola helegaloka Genesalete numutoka vi anitiake, nagamikú lape ali
    gaheva ake nagá ziake,
  lcm-lcm: Au, kila paputuk luai ane mang palpal na kianla ung alak e Genesaret, na
    kila rukang.
  aer-aer: Ikwerenge anteme itne kwatye alayenge arrengakwe ampinyeke-irreke apmere
    Gennesaret ikwerenge. Yanhenge, nhenge boat itnekenhe-arle ayerneke iperre renhe
    impemele, tyerrtye arunthe apetyewarrerlenge Jesus alhengke-areke.
  qvc-NT: Chaymandaqam barkupi chay atun qoch'ata pasashpaqa, Jinisarit pambaman ch'ayarqanllapa.
    Chayman ch'ayashpaqam, barkuta watarqanllapa atun qoch'apa manyambi.
  tgl-ULB: Nang makatawid na sila, nakarating sila sa lupain ng Genesaret at idinaong
    nila ang bangka.
  cbs-NT: Janua ianenwan pukei besusi bupananbun niwen jamakidi jatu bukin xutua mae
    betsa Genesaret anu keti itan jatun xaxu nexatan
  xtm-NTPP: Ni ka ya'a de ji'in ya nuu ndute ma, te ni ka kenda koo de ñuu Genesaret
    ma, te ni ka ju'ni de barcu de ma yu'u ndute ma.
  nnq-nnq: Ngabajomboka lilaba, ngabaika kukilambo cha ku Genesaleti, ngaba jemekanga
    ntumbwi gwabe.
  bao-NT: Ʉtabʉcʉrare tĩa ea waarã, Genesaret yepare ea, too maaupa.
  san-ORI: ଅଥ ତେ ପାରଂ ଗତ୍ୱା ଗିନେଷରତ୍ପ୍ରଦେଶମେତ୍ୟ ତଟ ଉପସ୍ଥିତାଃ|
  huv-NT: Tapeayiw necamb a yow tiül iüt Genesaret. Quiaj tawüw tiüt, taoeliw mimüxiw
    nejiw mbeay yow.
  otn-NT: Mi̱ zøn'a̱ nenthe ja ra̱ häi Genesaret, bi da̱t'yø barco 'mø mi̱ bøni̱.
  nop-nop: Ime fokolok looŋ muwage u tiŋa wooŋ Genesalet imeŋgwaŋ magineŋ tehiŋa ugiŋ,
  obo-NT: Na, to nokorunggu ran don diyot dipaa to lanow, noko-inguma ran diyot lugaa
    to Genesaret, woy id ikot dan iddos bollangay ran.
  cak-ENT: Y rije' xebe chic pari' ri ya' y xe'apon lojc'an chic ri lago pa jun lugar
    rubini'an Genesaret.
  lif-NT: ᤜᤧᤰᤁᤩᤠᤱ ᤂᤧᤱᤜᤠ᤹ᤖᤧ ᤘᤖᤰᤁᤡᤸᤗᤧ ᤏᤠᤎᤠ᤺ᤶᤒᤡ ᤔᤧᤃᤠ᤺ᤰᤋᤢᤀᤠᤱ ᤃᤏᤧᤛᤖᤧᤳᤋᤥ ᤔᤧᤃᤧᤖᤧᤀᤠᤱ ᤂ᤺ᤱᤒᤣᤴ
    ᤀᤡᤔᤧᤄᤣ᤺ᤰᤂᤢ॥ ᤕᤧᤛᤢ᤺ᤴ ᤂ᤺ᤱᤒᤣᤗᤠᤶ ᤗ᤺ᤴᤍᤧᤏᤢᤔᤧ᤺ᤴᤏᤣ ᤂᤧᤵᤔᤥᤒᤠ ᤔᤏᤠᤜᤠ᤹ ᤁᤧᤖᤧᤰᤗᤧ ᤂᤢᤏᤧ᤹ ᤁᤢᤛᤡᤱ ᤔᤧᤏᤡ᤺ᤳᤋᤢ॥
  snx-snx: Yesus ido sox suma jagar kubung pesne yag inggamx Genesaret so nenx desne
    kubung sel nding youbxo.
  kql-kql: De, Jisasɨlɨn wokok guŋgundandi maŋamguan aŋgɨndaŋɨk govevekandi Genesaret
    galavale mɨtɨk ŋɨme balɨ dɨŋeve.
  mie-NT: De nī nchāha yā jíín ndá dē incā lado mar, de nī nquenda yā región Genesaret.
    De yuhú ndúté ñúcuán nī juhnī ndá dē barco.
  san-TIB: ཨཐ ཏེ པཱརཾ གཏྭཱ གིནེཥརཏྤྲདེཤམེཏྱ ཏཊ ཨུཔསྠིཏཱཿ།
  qve-NT: Jesusqa discipulonkunapiwanmi laguna qochata chimpaspa, Genesaret allpaman
    chayaranku. Hinaspan risqanku boteta laguna qochapa patanpi wataranku.
  pao-NT: Ka Gennesaret mee naneadu-kwi umu natzemange petuse, tu sake o tzakuna,
  cbu-NT: Ashiriya, minush zari yusur musaatssha kíteersin, tsap Kinísaritash sura
    anush matayarangana.
  usa-usa: nokaayúkóní meran-ábápáq-ágínáúpáqá iréta mararáqá Kénnétáaretibaqa yáá
    amakéta nópí-káárémá ánnáraqa kútaae.
  soy-soy: Mɛtɛ́ŋ́-mɑɑ́ ɑpi Kenesɑrɛti kɛtẽ tulu, ɑpi rikóitimɛ pikuninɔi kɑrii.
  bkx-bkx: Olas sin nnaon ntee nifu ꞌnaek in panin, sin nsaon mbi kuan Genesaret in
    nifu ninen.
  hui-hui: Ani bialu ti iba timbuniore bereago doma ede halu dindi mbira mini Genesarete
    anda puwa iba talu pume pongo bia halu angeni ngelene.
  amf-amf: Yesusbee kisa paanan yivayna eenabe bazinam sagayse Gensareth peendar ke
    yivade; bazindara sagadhen gonngalanamaar bazinsa gasante ke dhaxade.
  quc-NNT: E q'axinaq chi ch'äqäp che ri mar, xeopan chuchi' ri ulew pa Genesaret,
    xkixim k'u ri ki barco chila' chuchi' ri mar.
  dob-dob: ꞌEnega siabala sena Genesaleta ꞌenaya ga leꞌawinaya silugu ga ꞌidi waga
    gote ꞌena siloomuna.
  wrs-wrs: Doa plombmonam os wongavna, pethara pulvonamba, Genesaret pethara pulvona,
    wo botva engalla viliheivna,
  mca-mca: Qa in hats t'atsji'ƚik'uipha'mkii ke' qi kaƚi', qa yamets hakha' sehe'
    Genesaret, qa hikha' yopheƚi' ke' witinhitjii.
  tzo-TZC: Tey echꞌ stuchꞌic ti nabe. Icꞌotic ta Genesaret banomil. Tey laj xchuquic
    comel ti barco ta tiꞌ nabe.
  mya-mya: ကိုယ်​တော်​နှင့်​တ​ပည့်​တော်​တို့​သည် အိုင်​တစ်​ဖက် သို့​ကူး​ကြ​၏။ ဂင်​နေ​သ​ရက်​မြို့​သို့​ရောက်​လျှင်
    လှေ​ကို​ဆိုက်​ကြ​၏။-
  gng-NT: Yesu nin uʼpanpaankaab tì baa' miñunciɛnm ya gbaatɔl, Genesarɛt ya tinfɛnm
    ni, ki ñɛn' buñɛrbu ni, nɛ ki lòle' bù.
  cbi-NTPO: Juntsa-i' aa pusu bejkusha detyakatu Genesaret tushaa tyuinajila, tsejtu
    yala' baaku deteetsure' lula.
  ikk-NT: Ogẹn wẹ gi fetugụụ “ohimin” hụ, e ru wẹ obodo Gẹnẹsarẹtị, wẹ nọ limẹ ụgbọ-mirin
    wẹ ebẹhụ.
  leu-leu: E nari, ri falet xuluna xaati xe la bina Genasaret e ri ung e pis fatateak
    a xaati pave.
  maz-NT: O zät'äji c'ua cja 'nanguarü c'e zapjü cja c'e xoñijõmü c'ü xiji Genesaret.
    O ndün't'üji na jo c'e bü'ü.
  bod-N: དེ་ནས་ཁོང་རྣམས་མཚོ་བརྒལ་ནས་གེན་ནེ་སཱ་རེལ་གྱི་ས་ཆར་སླེབས་ཤིང་མཚོ་གྲུ་ཡང་མཚོ་འགྲམ་དུ༌བཏགས།
