    serey piynay.
  tvk-tvk: Melele xa langgur xoteh Oei Kaleli e mei laduxoh tan na mol‑Kenesaret xil,
    labe ut e labar bot nae.
  prf-NT: Dikona makaarabes dán hidi ay pummundu hidi ten banuwan a Genesaret.
  auy-auy: Táátafesa áfááraumai ésa waaúnkóní menáípáꞌá Kénésáréti-marafaꞌo kumbá
    nonáwáífaꞌa nompín-táómba ándá káráꞌumaresa
  tbg-tbg: Vinavuka oru vi varuva namari hini mantaraini Kenesareti vataini orure
    vaavire votu rumpate
  hub-NT: Kucha amain Genesaretnum jeaawar, boten jigkaawar aepenak,
  hmo-hmo: Davara idia hanaia, vadaeni Iesu bona iena diba tahua taudia idia kamokau
    Genesareta kone dekenai.
  big-big: Puwili weik kai kolamiyabekke pangazuwage ngabelak Kenesare meibekke lewagela
    logo puwili wangleiga welagela logo puwiligu wanglei paka kaingimbekke ngalege
    wiya logo pilik mizageyarik yongkambanu yereng puragawili Yisu mamiza logo
  gux-G: Ban bo dugi m ñinciama b bo pundi Senssareti ya tinga nni ki gɔ sieni u ñinbiagu
  cnl-NT: Ca²³'øn³te'²³ jmɨ²³ñii'³¹. Ca²³dxi²³guín²³te'²³ 'uǿ²³ je² xi̱i̱n³ Genesaret.
    Ca²³'ñʉ'²te'²³ móo² ji̱i̱'² jmɨɨ³.
  zar-NT: Gulaʼdödëʼ Jesús, en yuguʼ bönniʼ dáʼgaquiëʼ Lëʼ iaʼtsöláʼa nísadoʼ, ateʼ
    bilaʼdxinëʼ ga naca lu xiyúgaca bönachi Genesaret. Buluʼdxíguëʼë bárcodoʼ luyú
    bidxi niʼ.
  kde-kde: Yesu na vakuhundwa vake pavayombweke litanda, nkuhwika chilambo cha ku
    Genesaleti, anepo nkuimija ingalava yavo.
  ata-ata: Iloꞌa mixisaꞌisou kupa ne, xe milai mixali xalee vile ne Xenesaleti, la
    milea lavoꞌosou muluꞌelai mole uaxa mupuapuatisi.
  qvw-NT: Chay ućhäta pasälälimulmi Genesaret malcaman ćhälälila.
  nfa-nfa: Ropa rèngu dꞌai cabèka dano, ra panahu koha ètu dae Genesaret.
  tnp-tnp: Kəməhuvən e nəve nɨtəni=pən məhuvari əpəha ikɨn kəti nərgɨn u Kenesəret,
    kəni motiuvi-ərain bot ikɨn.
  urd-urd: और वो पार जाकर गनेसरत के इलाक़े में पहुँचे और नाव किनारे पर लगाई।
  hot-hot: Thêlô ethak liŋdaŋ vi tuvulu anêŋ Genesalet ma êthô yeŋ hamô.
  mqj-NT: Lambanni tasik sola passikolana ullambi'mi Genesaret. Turunni yao mai lopi
    tappa naissanan tau kumua Puang Yesus.
  rus-SYN: И, переправившись, прибыли в землю Геннисаретскую и пристали к берегу.
  mbh-mbh: Jisas ome ile wainlangaere, o mon a thei a pamonlel a wo epee, ma o otuno
    a epee ako a Genesaret, ma o otunu oa wok.
  bdd-bdd: Coinega sihabala tupwa Genesaleta gadowaina ꞌoina, siluhuwa, ma ꞌidi waga
    nage ꞌoina silohoya.
  cbt-NTPO: Aquëtëran canconahuatona', Quinisariti parti nonshipi. Yonsanquë poti
    a'sonpi.
  srn-NT: Di den koti a meer abra, den doro ini a kontren di den ben kari Genesaret.
    Dan den go na syoro.
  cta-NT: Liꞌ ndyalaa yaca niꞌi̱ chaca tsuꞌ tayuꞌ loꞌo nguꞌ, ca loyuu su cuentya Genesaret
    ndyalaa nguꞌ liꞌ. Loꞌo ngusca̱ꞌ nguꞌ jiꞌi̱ yaca niꞌi̱ biꞌ,
  bqc-SIM: Kɛ́ aa bùa baa aa kà Gɛnɛzalɛti, ↄ̃ aa godↄ̀ we.
  tcz-CHONGTHU: Chuin agalkaiyun Gennesaret gamsung alhung un, kong chu twipam chin'ah
    anga tauve.
  mar-mar: त्यांनी सरोवर ओलांडल्यावर ते गनेसरेतला आले व तारु बांधून टाकले.
  snp-snp: Ido nofuna ya yofototo uto Genesalete mikalo fedeti sipi no anawalo nela
    witi olu kiki loti
  isl-isl: Þegar þeir komu til Genesaret hinum megin vatnsins stigu þeir á land og
    bundu bátinn.
  spy-NT: Kumii ꞉Yēēsu ākoo rubiikyii mwēēnkēēt, kutākyi keey Keneesareet. Yu kayit
    wōlooto, /kiiyyoong'to mwēēnkēēt /ankeerat simeenaata.
  xnn-xnn: Nakagdangda pay et omdanda isnan dagan di Genesaret dadat ipad-an nan bangkada
    isnan lota isnan benget di baybay.
  mwe-mwe: Gubhajombokenje litanda, gubhaikengene ku shilambo sha Geneshaleti gubhajimingene.
  tte-tte: Silopanaisi dedei Genasaleta koina siulisi, galowa mena silo.
  tcs-tcs: Orait nau. Dempla ebriwan bin go po da nadasaid blo da leik po wan ples
    neim Genesaret. Wen ol bin kam de, dempla bin angka da bot
  hlt-THB: Vang ben caqai sa na cet unawh, Genesaret ce pha unawh, cawh ce dym uhy.
  soq-soq: Mo nawane antone bola Genesaretiwa wimone waa taunadodeiena.
  qub-qub: Jesús disïpuluncunawan gochata chimpar chayaran Genesaret partimanna. Chayaycärir
    gocha cantunman can'wanta wataran.
  att-att: Á ta pakáddè di Apu Kesu ta dammáng, minay ira jiminung sù dappâ na Gennesaret.
  bki-bki: Ana Yesu nalo abarkorov ueiyabo neibano aban ea kialo uako tivelinio, naruei
    aba aboru ea vio tai, siano Kenasarete. Mia bogo na abuku veru ba uro,
  bqp-bqp: Kũ ò bikũ̀ bara, ò kà Gɛnɛsarɛti, akũ ò ń gó bàa dↄ̀ gwe.
  mcp-mcp: Bwə́ mə́ shîn lɨ́ɨ́na mâŋ, bwə́ mú jé lɔɔm á Genezarɛ̂t, bwə́ mú səl byɔ́ɔl.
  hat-hat: Yo fin travèse lanmè a, yo fè tè toupre lavil Jenezarèt. Yo mare kannòt
    la atè.
  npl-NT: Ijkuak okalakitoh Genesaret, ompa inakastla n lago okilpijkeh n barka.
  bgg-bgg: Ithek ne khabang ji hiìa ne Genesareth beng pha soh shii wuii thog, thiichiih
    shii ithek è run ne phang ne ruii marui srane lung dun.
  eng-TCENT: When they had crossed the sea, they came to the land of Gennesaret and
    moored the boat.
  eng-BSB: When they had crossed over, they landed at Gennesaret and moored the boat.
  cpu-NT: Irojatzi jareetantaiyapaakari inampiki Genesaret-satzi.
  san-ASM: অথ তে পাৰং গৎৱা গিনেষৰৎপ্ৰদেশমেত্য তট উপস্থিতাঃ|
  tac-NT: Napu'lige sebasa wa'lú ba'wichí suwé alé napu Genesareta anilichi nile,
    alé a'rele chega alué barko.
  eng-WEBPB: When they had crossed over, they came to land at Gennesaret and moored
    to the shore.
  gfk-H: Bia Iesu ma ira nuna bulu na hausur diet ga balas tar no tamat na taah kis,
    diet ga hanuat taar tano hanua Genasaret. Kaia, diet ga his kahai tar no mon.
  viv-viv: Tu tobuya hidamanaꞋela-yo fafali ana egana Genesaleda againe hihobu waka
    hiluhifona.
  yao-yao: Che Yesu pamo ni ŵakulijiganya ŵao ŵajombweche litanda, ŵaiche ku Genesaleti,
    pelepo ŵajijimiche ngalaŵa jao.
  tgp-tgp: Iesu tolu na nona tamlohi lara la vano roto na tasi la pala Gennesaret
    la sahe la hoso,
  auc-NT: Ayæ̈ æ̈mæ̈mäa taodinque tömënäni Guënetadetebæ ti wææ̈ninque wipo ñä cæmencadänitapa.
  kbc-NT: Niɡ̶ijo naɡ̶a diɡ̶etitacicoace daato weiigi, odaa joɡ̶otota nipodigi Genesaré,
    odaa joɡ̶oigoetini naɡ̶ajo niwatece liniogotibece weiigi.
  bmh-bmh: Yesus gonugau tapaimaraneu dudu abai ereg go ze unig matelai beteimai,
    Genesaret em gasageim beteimai, go ebu tebil us sil kiai memen.
  ctu-BL: Che' bʌ tsa' c'axiyob ti junwejl ja', tsa' c'otiyob ti lum ya' ti Genesaret.
    Tsi' cʌchʌyob barco.
  meq-meq: Ma dəba eye nakə Yesu ta gawla ŋgay hay tə tas abəra ma dəlov niye aye
    na, tə ndisl a gəma eye andaya tə zalay Genesaret. Tə ndisl a ɗəma na, tə ɓar
    na, kwalalaŋ i yam tay ka pəpəz i dəlov niye.
  noa-H: Maimua warag hãba hërëubaadëwi t'oom higar deeum durr Genesaret hanʌm p'ẽeubagk'abaimaawai
    warre hamach wëttarr bote jʌ̃ sĩujim haajem.
  alp-NT: Kena esi ndi teba peneka, eleki esi tati me otoi Genesarete.
  san-VEL: atha te paara.m gatvaa gine.saratprade"sametya ta.ta upasthitaa.h|
  kbq-kbq: Hanki kantu kaziga takahe'za Genesareti mopare uhanati'za, votia kina rentete'za,
  kbh-kbh: Chë uafjajónaye tmojánenashbuachengo ora, Genesaret ca uabaina luaroye
    tmojánashjajna, y chë uafjajónaye tsachoca chë barquë́sha tmojanë́tsbua.
  ron-LSB: După ce au trecut dincolo, au ajuns la țărm, la Genesaret, și au acostat
    la țărm.
  pon-pon: Irail lao kotido, re ap inen don wein Kenejaret, ap kai on liman jap o.
  nhe-BL: Jesús huan imomachtijcahua quiixcotonque nopa hueyi atl huan ajsitoj ateno
    ipan altepetl Genesaret. Huan nepa quiilpijque inincuacanahua.
  sps-sps: Tan nainy te guas naa ri, ri nai sung to tana pan iny Genesaret, ri tang
    iny ton puak.
  wnc-wnc: Siwan yangga gapan kwaimune kuke Genesaret kep komune kundoke dopangbam
    gwenu awamateking.
  bus-bus: Kɛ̀ aↄ̃ bikũ̀ baa, aↄ̃ kà Gɛnɛsarɛti, ben aↄ̃ ń góro bà dↄ̀ gwe.
  gub-BL: Upyterahaw yryhu oho wà kury. Uhem oho Zenezare ywy rehe wà. Uzàpixi kanuhu
    'y izywyr wà.
  imo-imo: Kelko no mongolu kanomu toko pule toko, Genesaret nimbe kombu tenga wendo
    puringi. Aku kombuna sipimu kareko noiringi.
  boj-boj: Ariya Yesus aqa aŋgro naŋgi koba na qobuŋ na gilsib ya agu taqal beiq di
    brantosib Genesaret sawaq di tiryeb.
  ulk-ulk: Wige gur tadatupidarda tabakiauda ge wege Genesaretge, ge nade wi nar didbarda.
  eng-DRA: And when they had passed over, they came into the land of Genezareth, and
    set to the shore.
  knf-knf: Wi bamuuruŋ, aban du pkay du uŧaak wi bagenaŧereŋ, bakaban bţeem ţi kabaŋ.
  san-KHM: អថ តេ បារំ គត្វា គិនេឞរត្ប្រទេឝមេត្យ តដ ឧបស្ថិតាះ។
  arn-NT: Nopuy engün tati pichi lafken mew, fey puwi engün ta Genesaret mapu mew,
    fey üye mew trarintukukünupuy engün tañi farku inaltu ayliñ mew.
  zas-NT: Chi ma gudëd reeman lojnijs guin bidxin reeman xdajn ree bén Genesaret,
    yagaj guxhii reeman barcw guin roꞌ nijs.
  ken-NT: Yesu nɛ baghɔkɔ́ bhi mánáŋá nɔ́kɔ́ bɛpe manyu, bákó ɛbhɨ, atú Gɛnɛ́sarɛt.
    Básɛt áchwí wap.
